import { httpService } from './';
import { apiUrl } from '../config';

export const reviewService = {
    postReview,
    updateReview,
};

const apiEndpoint = apiUrl + '/review';

function postReview(body) {
    return httpService.post(apiEndpoint, body);
}

function updateReview(reviewId, body) {
    return httpService.put(`${apiEndpoint}/${reviewId}`, body);
}
